import playBtn from '/var/www/vhosts/website/src/Assets/Images/play-btn.png';

const NowLiveComponet = ({ show, onHide }) => {
  return (
    <div className='nowlive-container' style={{backgroundImage:`url(${bgImage})`,backgroundRepeat:'no-repeat',}}>
      <div className="liveFlag" >
         Now Live
      </div>
      <img src={playBtn} alt=''/>
      <div className='content'>
        <h2>Live Now</h2>
        <p>September 14, 2024</p>
      </div>
    </div>
  );
};

